C语言常量与指针
常量
变量和常量最大的区别就是变量的值可以被修改，但是常量的值不能被修改。
在C语言中，可以将变量变成具有常量一样的特性，那就是利用const关键字：
const int cnum = 880;

在const关键字的修饰下，变量cnum就会失去可修改的特性，也就是变成只读的属性。
指向常量的指针
指针可以指向被const修饰过的变量，这就意味着不能通过指针来修改它所引用的值。但是指针本身是可以修改的。
#include 

int main() {
    int num = 520;
    const int cnum = 880;
    const int *pc = &cnum;

    printf("cnum: %d, &cnum: %p \n", cnum, &cnum);
    printf("*pc: %d, pc:%p \n", *pc, pc);

    // 尝试修改 *pc 的值是不允许的
    *pc = 1024; //  &#x2715;

    // 但是可以修改指针的指向，之前是指向 cnum，现在指向 num
    pc = &num ;  // &#x2705;

    // 可以通过变量名来修改变量的值
    num = 1235; // &#x2705;


    // 无法通过解引用指针来修改
    *pc = 1111; // &#x2715;

    printf("*pc: %d \n", *pc);

    return 0;
}

指向非常量的常量指针

