二叉树的遍历
将如图的二叉树按前中序和按层遍历

前中后序遍历

package main

import "fmt"

type TreeNode struct {
    Value byte
    Left  *TreeNode
    Right *TreeNode
}

// 前序遍历
func preorderTraversal(node *TreeNode, values []string) []string {
    if node != nil {
        values = append(values, string(node.Value))
        values = preorderTraversal(node.Left, values)
        values = preorderTraversal(node.Right, values)
    }

    return values
}

// 中序遍历
func midOrderTraversal(node *TreeNode, values []string) []string {
    if node != nil {
        values = preorderTraversal(node.Left, values)
        values = append(values, string(node.Value))
        values = preorderTraversal(node.Right, values)
    }

    return values
}

// 后序遍历
func postOrderTraversal(node *TreeNode, values []string) []string {
    if node != nil {
        values = preorderTraversal(node.Left, values)
        values = preorderTraversal(node.Right, values)
        values = append(values, string(node.Value))
    }

    return values
}

func main() {
    node := &TreeNode{
        Value: 'A',
        Left: &TreeNode{
            Value: 'B',
            Left: &TreeNode{
                Value: 'D',
                Left: &TreeNode{
                    Value: 'H',
                    Left:  nil,
                    Right: nil,
                },
                Right: &TreeNode{
                    Value: 'I',
                    Left:  nil,
                    Right: nil,
                },
            },
            Right: &TreeNode{
                Value: 'E',
                Left: &TreeNode{
                    Value: 'J',
                    Left:  nil,
                    Right: nil,
                },
                Right: nil,
            },
        },
        Right: &TreeNode{
            Value: 'C',
            Left: &TreeNode{
                Value: 'F',
                Left:  nil,
                Right: nil,
            },
            Right: &TreeNode{
                Value: 'G',
                Left:  nil,
                Right: nil,
            },
        },
    }

    values := make([]string, 0)
    fmt.Println("前序: ", preorderTraversal(node, values))
    fmt.Println("中序: ", midOrderTraversal(node, values))
    fmt.Println("后序: ", postOrderTraversal(node, values))

}

